import React, { Component } from 'react';

class DiyList extends Component{

    state = {
        list: ''
    }

    render(){
        const category = this.props.category;
        switch(category){
            case 1:
                this.setState({list: 'motor'});
                break;
            case 2:
                this.setState({list: 'wings'});
                break;
            case 3:
                this.setState({list: 'frame'});
                break;
            case 4:
                this.setState({list: 'control board'});
                break;
            case 5:
                this.setState({list: 'esc'});
                break;
            case 6:
                this.setState({list: 'battery'});
                break;
            case 7:
                this.setState({list: 'antenna'});
                break;
        }
        return(
            <div>
                <h2>List</h2>
                {this.state.list}
            </div>
        );
    }
}

export default DiyList;
